<p><hi rend="bold">نەنچاڭ شەھىرى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭگو">جۇڭگو</ref> <ref target="https://ug.wikipedia.org/wiki/جياڭسى_ئۆلكىسى">جياڭسى ئۆلكىسى</ref> دىكىبىخاھار 2007 نوپۇس بار، نەنچاڭنىڭ 3،790،000 نوپۇسىبار، 514.1 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 28.41°، خارىكى ئۇزۇنلۇك 115°53، پوقتانومۇرى 330000 رايۇننومۇرى 791.</p>
